  description: "A predictive mathematic models of the COVID-19 pandemic.",
  cover: cover,
  tags: [
    projectTags.ml,
    projectTags.datacleaning,
    projectTags.web,
    projectTags.django,
    projectTags.react,
  ],
  detail: <ReCOVERDetail />,
};

export default ReCOVER;
